impl Solution {
    pub fn find_high_access_employees(access_times: Vec<Vec<String>>) -> Vec<String> {
        use std::collections::{HashMap, HashSet};

        let mut employee_access: HashMap<String, Vec<i32>> = HashMap::new();
        for access in access_times {
            let time = access[1][0..2].parse::<i32>().unwrap() * 60 + access[1][2..].parse::<i32>().unwrap();
            employee_access.entry(access[0].clone()).or_insert_with(Vec::new).push(time);
        }

        let mut high_access_employees: HashSet<String> = HashSet::new();
        for (employee, times) in employee_access.iter_mut() {
            times.sort_unstable();
            for window in times.windows(3) {
                if window[2] - window[0] < 60 {
                    high_access_employees.insert(employee.clone());
                    break;
                }
            }
        }

        high_access_employees.into_iter().collect()
    }
}
